import React, { Component } from 'react';
import { InfoConsumer } from '../context';
import Info from '../Info';

class Home extends Component {
    render() {
        return (

            <div className="container">
                <div className="row mt-5">
                <InfoConsumer>
                {value => {
                    return value.info.map
                }}
            </InfoConsumer>
                </div>
            </div>
        )
    }
}

export default Home;
